INSERT INTO `bots_pet_responses` VALUES ('pet.sad', 'Hoy no es uno de mi das...;*triste*;Hoy no es un da feliz...;No tengo nimos hoy;Hola? Necesito a alguien que me de compaia...;:(;Sabes? Quiero morir, no tengo nimos para nada...;*demasiado triste*;Adis, adis, no hay objetivo aqu...;Quizs dormir para siempre sea lo mejor...');
