INSERT INTO `bots_pet_responses` VALUES ('speech.pet16', 'Aunque no te lo creas, sola sustituir a George Michael.;GWAR me ha ofrecido tocar el bajo, pero les he dicho que no tengo manos.;Sabes lo que me encantara? Tener piernas!;*Eructo*;*Pedo*;*Ronquido*;gst,lgh;gst,hpy;eyb;Oye, oye, oye!;gst,ywn;Oye, cmo ests?');
INSERT INTO `bots_pet_responses` VALUES ('speech.pet16.die', 'Por fin ya podr dormir!;Hola colega, me ibas a ayudar? es muy tarde...;*ahogo* Adis mundo cruel....;Vaya! Me he muerto!;Por fin podre dormir!;Soy el ultimo superviviente del tiesto y voy a desconectar.;Tu descuido me ha matado!;Me he muerto! Un poco de ayuda, colega? Haz lo de Lzaro!;Despus de ver cmo te cortas las uas de los pies, No me da miedo morir! Adis!;Canto me alegro de verte por aqu!;Podemos decir que he muerto oficialmente.');
