INSERT INTO `catalog_pages` VALUES (351, 301, 'Info Wired', 42, '1', '1', 1, 0, 0, '', 'info_duckets', 'catalog_wired_header1|info_wired', '<i><b><font color=\"#63af07\" size=\"16\">Cmo uso los Wired?</font></b></i><br>\r\nLos Furni WIRED sirven para que tu sala sea ms interactiva, o tenga eventos especiales. Quieres que las puertas se cierren con un comando?\r\nLos WIRED estn divididos en tres simples categoras:\r\n\r\n<a href=\"event:habbopages/wired_triggers\">Causantes:</a> Es lo que \'causa\' que los efectos sean activados, es como decir: si jalas una palanca se activarn los efectos progamados en este causante.\r\n\r\n<a href=\"event:habbopages/wired_effects\">Efectos:</a> Lo que quieras que pase en el momento de ser activado, puede ser: mover objetos, girarlos, encender lamparas, etc.\r\n\r\n<a href=\"event:habbopages/wired_conditions\">Condiciones:</a> Quieres activar algo pero, slo quiero que sea activado en un lugar especfico? Con las condiciones estableces lmites para que el causante funcione.\r\n\r\n<b>Nota:</b> Para que todo funcione debes apilarlos sobre la misma pila.\r\nHaz clic sobre los <u>textos marcados</u> para ms informacin.');
