INSERT INTO `server_locale` VALUES ('publialert_new_f', '<b>No tan rpido!</b><br><br>No llevas ni 30 minutos registrada... y ya ests diciendo un hotel? Esto ser breve:<br>Si vuelves a decir el hotel mencionado sers automticamente baneada por el sistema antipublicistas, no importa si pones caracteres raros o espacios igual te detectar y habrs perdido tu valioso tiempo autobaneandote.<br><br>Te damos la oportunidad de que esto quede en el pasado y explores tu misma, o si quieres ir a la contraria ya sabes que hacer.<br><br>Es tu eleccin.');
INSERT INTO `server_locale` VALUES ('publialert_new_m', '<b>No tan rpido!</b><br><br>No llevas ni 30 minutos registrado... y ya ests diciendo un hotel? Esto ser breve:<br>Si vuelves a decir el hotel mencionado sers automticamente baneado por el sistema antipublicistas, no importa si pones caracteres raros o espacios igual te detectar y habrs perdido tu valioso tiempo autobaneandote.<br><br>Te damos la oportunidad de que esto quede en el pasado y explores tu mismo, o si quieres ir a la contraria ya sabes que hacer.<br><br>Es tu eleccin.');
